article_content:
저희 집은 식탁 위에다가 밥솥이랑 전자레인지를 놓고 써서 식탁이 너무 좁았었어요~~ 그래서 전부터 선반 같은 거를 하나 사서 놓고 쓰려고 했었는데 이제서야 샀네요. ㅎㅎ;;

저런 선반을 처음 조립 해 보는 저로서는 조립이 좀 어려웠어요~~ 쉬울 줄 알았는데 생각보다 어렵더라고요. 처음에 판을 거꾸로 껴서 다 조립 하고 나서 밥솥이랑 전자레인지를 올렸는데 많이 흔들거리더라구요. ㅋㅋ;;

조립 할 때도 좀 이상했는데 계속 보다 보니까 아무래도 이상해서 후기를 봤는데 제가 저 판을 거꾸로 끼운 거였어요.. ㅋㅋㅋ
거기에 대한 설명이 자세히 안 나와 있어서 별 하나 뺐어요.

설명서엔 조립하는 방법이 너무 대충 나와 있어요. ㅠㅠ 저 같은 초보자들한텐 어려울 수 있겠어요. ㅠㅠ

아무튼 제대로 다시 조립 하고 나니까 좀 안정감이 있더라고요. 처음에 잘못 조립 했을 때 보다 확실히 덜 흔들려요~ 크기도 적당해서 자리도 많이 안 차지하고 높이도 적당하네요. 설명서가 부실한 것 빼고는 나름 괜찮아요~~ ㅎㅎ
